		lore: 'Buried beneath the crust of the world descends the cruel hells of torment. The topmost of which are realms of torture and vile inhumanities, home to denizens of darkness and malice. Yet, further into the black below, at the inkiest recesses can be found the horrific ninth hell. Here dwells a deity of true evil, gloating over each corpse he’s claimed with macabre glee, and relishing the moment more of these lesser souls are his. He is Ah Puch, the mightiest lord of the ninth hell.<br /><br />When night falls, Ah Puch roams the land, crowned by a wreath of human eyes, gruesome skull face bared for all to witness, accompanied by the shriek of ghostly owls. All that live are his for the taking. If Ah Puch finds a human in the night, he kills and drags the unfortunate into endless oblivion. Only those already wracked by his servants, those caught in gut-wrenching wailing, moans of agony, and fits of mania are safe from his touch.<br /><br />Hide now, all men and Gods, for the age of eternal night has come. Ah Puch will reap anything that lives. There is great vacancy left in the nine hells, and the Horrific God of Decay wishes only to fill it.',
