		health_per_lvl: 86,
		lore: 'Regal, powerful, the Dragon-God of the Eastern Sea commands storms and tides with the flick of a claw, yet he seethes with rage for past humiliations.<br /><br />As one of four Dragon-Gods, Ao Kuang demands tribute from those along the Eastern shores. For their worship, tides remain calm, rivers contained, and rainfall for crops plentiful. It was not always like this, however. Long ago, Ao Kuang grew greedy and expected greater sacrifices. When they were not given, he sent floods, tidal waves, and devastating storms, striking so much fear into the people they dared not speak of this violence to the Jade Emperor. Ao Kuang enjoyed his total control.<br /><br />Then came Sun Wukong to his undersea palace seeking a weapon for his famous journey to the West. Despite the offer of other weapons, Sun Wukong took the Ruyi Jingu Bang, an immense pillar that aided in controlling the tides. It was believed none could even lift it, but Sun Wukong spun it with ease. As if this were not humiliating enough, Sun Wukong demanded other gifts of armor, shoes, and helm, all of which Ao Kuang was forced to supply.<br /><br />Next, the demigod boy Nezha, playing in a stream, inadvertently shook Ao Kuang’s palace. Annoyed, the Dragon-God set forth his favorite scout to kill the child, but Nezha defended himself and the scout was slain. Furious, Ao Kuang ordered his third son to destroy Nezha, yet Nehza slew him as well. Completely outraged, Ao Kuang went to Nezha’s father and threatened to take the issue before the Jade Emperor, but Nezha tackled the Dragon-King and forced him to submit.<br /><br />Such repeated shame and humiliation have both humbled Ao Kuang and tempered his fury to steely resolve. Long has he awaited his chance to rise again and exert dominance as a great Dragon-God of the Sea.',
