		lore: 'There are none without admiration for Apollo, God of Music. He is brash, cavalier, and dauntless, with the power to bring hope to the hopeless and change the course of battle with a single arrow. Voices of soldiers, mothers, kings and emperors, even Gods rise in glorious melody in honor of him; and he, basking in their adoration, shines victoriously.<br /><br />Though Hera, Queen of Gods, challenged his very birth, sending the great serpent Pylos to slay Apollo, his twin sister Artemis, and their mother Leto, not even she could deny him victory. Merely four days old, Apollo, gifted with a legendary bow, slew the Gaia Serpent and defied Hera.<br /><br />In his humble youth, Apollo was a cattle herder. The trickster God Hermes stole Apollo’s charges and led them to a nearby cave. From the shell of a tortoise and the body of a cow, he crafted the first Lyre. Apollo finally caught up with Hermes, saw the instrument, and simply had to have it, trading the rest of his cattle to Hermes for it. Years later, Hermes would send his son, Pan, to challenge Apollo in a contest of musical prowess, but Apollo soundly defeated the satyr with dexterous mastery of the Lyre.<br /><br />As Apollo grew into his rightful place among the Gods, his victories mounted, and the songs of the Faithful were sung more and more in his name. Now, they raise their voices for Apollo to take the field as Gods clash. Never one to deny his adoring public, Apollo prepares for one last show.',
