		lore: 'Ice melts in cascading waterfalls from jagged mountain peaks, pouring into rivers roaring white to the cold sea. Straightening slowly, like aged men, trees and fauna of the underbrush, now free of snow-weight, reach for the sun. It is spring; the world awakens from darkness and death to grow green again. Her hibernation ends. Coat wet with fresh rain, Artio, Goddess-Bear, roars into the chill morning air.<br /><br />She is guardian of the cycle. Not the passage of time, but the balance of things. There is no spring without winter, no death without life, no darkness without light, no goodness without evil. Nature declares these opposites into law and Artio is the enforcer.<br /><br />Among the ursine she runs, sometimes in the shape of a woman, lithe and wild, sometimes as a bear, brown and fierce. Nowhere in the forest do there stand shrines in her name, for Artio is less worshipped and more respected. Perhaps, instead, she looms overhead, a constant presence in the twinkle of the stars, a connection of glistening light; the constellation Ursa Major.<br /><br />And now there is war. None could know peace without war, victory without defeat, glory without failure. Artio must join those that fight if only to enforce the cycle of things. Nothing and no one defies the laws of nature like a God.',
