		lore: 'Reveling in the joys of life, Bastet, daughter of Ra, is the sensual embodiment of her feline form. This cat, however,  has the fiercest claws.<br /><br />Cats are creatures that demand worship. They are regal, nonchalant, and insatiable. Though, as much as they languish in the sun and rumble with purrs of pleasure, cats are agile and deadly hunters. Mercilessly, they cull the populations of invasive vermin and stinging scorpions, protecting the home from vile invaders. Perhaps, the most troublesome enemy of the cat is the serpent, and there was no greater snake in the world than the horrendous Apep.<br /><br />Circling the world along the horizon line, Apep’s scaly girth waited in ambush each morning for Ra to rise and bring light to the world. To fend off this beast, Ra kept the company of his daughter, Bastet. Since time began, as Ra lifted into the Eastern sky, Bastet would spit and howl, claws bared against the treacherous Apep. Countless battles were fought, countless mornings faced uncertainty, until, at last, Bastet tore the foul serpent apart.<br /><br />With her greatest enemy gone, Bastet is free to prowl as she pleases. Now, she is the guardian of home and hearth,  idol to women - especially those desiring children and exploring their sensuality - and patron of arts, wine, and any occasion of revelry. Like any cat, though, Bastet can still pounce without warning, shredding her enemies once her claws come out.',
