		lore: 'The dangers of the sea are many, but few so fearsome as the creature known as Charybdis. Ancient poems and songs speak of the destruction she has wreaked on any ship unlucky enough to pass too close to her turbulent waters.<br /><br />A sister in spirit if not blood to the nightmarish Scylla, Charybdis is a smasher of vessels where Scylla is an eater of men. She catches them in her whirlpool and breaks them into flinders, before drawing the pitiful remnants into the depths.<br /><br />Once a daughter of Poseidon, she had the temerity to aid her father in his perennial feud with his brother, Zeus. At Poseidon’s behest, she used her control over the waters to engulf those lands closest to the sea – including those that belonged to Zeus.<br /><br />This encroachment so angered the King of Olympus that he captured Charybdis. But such was Zeus’ wrath that he did not settle for mere imprisonment – rather, he transformed Charybdis into her current monstrous form as punishment for her defiance. He then cast her into the waters of a narrow strait, opposite the similarly cursed Scylla, and there chained her to the sea bed.<br /><br />In the centuries since, Charybdis has taken out her frustrations upon any who dared pass over the swirling waters that hid her now-hideous form. The whirlpools created from her unquenchable thirst either crushed ships, or drove them into the teeth of Scylla. Together, the two terrorized the waters of their imprisoning strait – until, that is, Scylla was freed to bring horror to the lands of the gods. Charybdis was left alone.<br /><br />But now, the chains that have held her fast since Zeus first cast her down have been broken. And mighty Charybdis is free at last to vent her rage on the gods who mistreated her so cruelly...',
