		lore: 'Chiron is a being of conflicted duality. Two opposites in one form. For all appearances, he is a centaur, bearing the torso of a man, and the body of a horse. Brutish, crude, and violent, the centaurs are not civilized creatures. Yet, Chiron is a scholar, a poet, an astrologer, and a teacher. And for all the wonder and glory of the world he tries to impart upon his illustrious students, Chiron, it seems, must constantly teach them the art of war. <br /><br />Fame and legend are the hallmarks of his pupils. Perseus, who beheaded Medusa, Ajax, who battled bravely against Troy, and Achilles, who Chiron practically raised from infancy, all are figures of renown. But it is for their acts of violence, not art or science, for which songs are sung of these heroes. Chiron would prefer the world a more contemplative place where mankind adored nature and kindled bonds of friendship over scholarly discussions. <br /><br />Though, to his wizened eyes, the brink has been reached and the world he finds so fascinating tilts toward annihilation. Set aside are his books and scrolls, the easel and brush, and taken up are his bow and armor. On thunderous hooves Chiron gallops to the field. To save all that he holds dear, Chiron, the Great Teacher, will go to war.',
