		lore: 'As the shadow of death spreads across the world, Cliodhna, queen of the banshees, emerges from her palace deep beneath the earth to haunt the lands of men once more. A daughter of the Tuatha De Danannan, she is beautiful and terrible in equal measure, and her keening signals misfortune to any unlucky enough to hear it, mortal or otherwise. Her magics are potent, and with them she can drive the sea into a frenzy or conjure storms. Such is her reputation that there are few who dare to face her on the battlefield or off.<br /><br />Though her aspect is sinister, Cliodhna is known to some mortals as a goddess of love and beauty, as well as a herald of death. It is said that her song can heal the sick – or end their suffering. Fittingly, she is known to have a great fondness for mortals – or at least those wise enough to honor her. She is said to sometimes grant boons to those who show her the proper respect even as she lures others to their doom for her own amusement.<br /><br />Despite this often-capricious nature, she is revered as a patron by those mortals brave enough to seek her blessings, and is known to watch over entire families. It is whispered that she even once took a mortal man as her betrothed and left the hidden lands of the Tuatha De Danannan for him – for a time, at least.<br /><br />Whatever the truth of such tales, Cliodhna is nevertheless also known as a herald of ruin and death. Her spectral form and eerie voice bring despair to those around her, and she is said to haunt those places where much blood has been shed. That she walks the world once more is sure sign that the long struggle between the pantheons of the world has at last reached its tipping point. But it is anyone’s guess whether the queen of the banshees has come to quell the conflict – or bring it to its inevitable conclusion…',
