		lore: 'Among the tanuki of Sado Island, one name is known above all others – that of Danzaburou. The supreme commander of all tanuki is infamous for his antics and his tricks are justly feared by mortal and immortal alike.<br /><br />A shape-shifter and trickster without equal, Danzaburou has never met a prank he would not pull. While these are mostly for his own amusement, he has been known to act on behalf of others, so long as he finds it entertaining. Even so, like all tanuki, he lives to cause trouble, and relishes every opportunity to show off his cleverness, as well as his capacity to cause havoc.<br /><br />Nowhere is this more evident than on the battlefield, where Danzaburou surrounds himself in chaos and confusion. He fights with great cunning. When not dodging his opponent’s attacks, or leaving a statue in his place to absorb the brunt of their wrath, he’s hiding in plain sight, waiting for his moment to strike. To say that Danzaburou is a frustrating opponent is an understatement.<br /><br />But Danzaburou brings more than just frustration – he is also a purveyor of good fortune. Jug of sake in one hand, and a promissory note in the other, the tanuki offers his opponents a drink and payment even as he plans his next trick or three. With his sly grin and big belly, the cheerful tanuki can turn even the staunchest of his foes into a friend – at least for as long as it takes to get to the bottom of a jug of sake.<br /><br />It is said that Danzaburou has been outwitted only once, by a human peasant. Ever since, the tanuki has refrained from playing tricks on hapless humans. Instead, he reserves his best pranks for what he considers to be a less perceptive audience...<br /><br />Namely, the gods themselves. ',
