		lore: 'When Eset was born, she was a Goddess. When she was married, she became a Queen. But a legendary journey to resurrect her murdered husband would make her a savior.<br /><br />From the God of Earth and Goddess of Sky, Eset was born, and she was a Goddess in her own right, loved by wealthy and poor alike, champion to sinners and slaves, artisans and aristocrats. She commanded the force of magic, for she knew the True Names of many things. For in the True Names lie true power.<br /><br />Eset and her husband Osiris ruled Egypt, symbols of order and justice, and led their kingdom to true prosperity. But Osiris had a brother, Set, who harbored jealousy and malice, and sought to usurp his throne. For him, murder alone was not enough. Set hacked Osiris to pieces and cast them across Egypt.<br /><br />Fleeing Set’s wrath, Eset traveled the land in secret, gathering the remains of her husband. Meanwhile, Set’s rule plunged the land into chaos incarnate, and all seemed truly lost. Unable to locate a final piece, Eset could wait no longer and summoned the potent powers of her magic to reassemble her husband and give him new life. That night, their love became a child, Horus, who would avenge his father and cast evil Set out of Egypt.<br /><br />Her bravery, tenacity, her skill and love drove Eset to save Egypt and become the mother of all Pharaohs. Long has she prayed that chaos would never again rise to threaten the rule of order and prosperity, but peaceful days are at an end. This time, it may not be her husband torn asunder, but all the world, and even the Goddess of Magic may not have the power to reassemble it from oblivion.',
