		lore: 'The deeds of King Gilgamesh are many. Some good, some bad. Some true, some false. Stories of his heroism – and his arrogance – are told throughout Mesopotamia. He has slain monsters and toppled kings; breached the gates of the netherworld and relieved the sorrows of the gods. Or so the tales claim.<br /><br />What is known is this – two thirds divine and one third mortal, it has ever been Gilgamesh’s desire to be a true god, and that desire has often led him down the wrong path. Though adventurous and brave, he was also a tyrant, imposing his will on his subordinates, until the gods sent the wild man, Enkidu, to teach Gilgamesh the error of his ways.<br /><br />However, after a fierce battle, the two demigods became friends. Together, they freed the Cedar Forest from the monstrous Humbaba and slew the Bull of Heaven. They fought monsters and tyrants, and with every victory, Gilgamesh’s renown spread until finally, even the gods took note.<br /><br />But his deeds, though mighty, were not enough to blind the gods to his overweening pride. Though his friendship with Enkidu had tempered his cruelty, his arrogance was undimmed.<br /><br />As a consequence, the gods slew Enkidu and Gilgamesh was left alone once more. But with his friend’s death came a new purpose. And so, Gilgamesh set off on his greatest quest – the quest for immortality. He travelled to far lands, and vanished from the sight and knowledge of men.<br /><br />Until now. Tiamat, the ancient foe of the gods, has returned, and Gilgamesh has returned with her. For if he can unite the pantheons of the world against the dragon queen and defeat her, perhaps the gods will give him what he seeks at last. ',
