		health_per_lvl: 84,
		lore: 'All paths have their guardians. And no guardian is more steadfast in their duties than keen-eyed Heimdallr, sentinel of the Bifrost. The watchman of Asgard is a sentry without equal in the Nine Realms and he maintains his eternal watch where the rainbow bridge meets the sky. With sharp eyes and keen hearing, Heimdallr stands guard over the halls of the gods, alert for the approach of any enemy as well as the first stirrings of Ragnarok.<br /><br />It is said that Heimdallr requires less sleep than a bird, and can see for hundreds of leagues. His hearing is so sharp that he can perceive the soft whisper of growing grass, and the murmur of the dead. His trumpet, Gjallarhorn, can be heard across the Nine Worlds when blown. But it is not only his senses which make Heimdallr a superb sentinel.<br /><br />He also possesses the gift of foresight, allowing him to predict his opponent’s moves before they occur and to sense the approach of inimical forces. As befitting one of the Aesir, he is a masterful combatant, and his foreknowledge gives him an edge over all but the most unpredictable – or skilled – of opponents.<br /><br />Too, it is whispered that Heimdallr has some connection to Yggdrasil, the World Tree. Some insist he was fashioned whole from a splinter of the great ash tree, while others believe he is bound to it in some fashion, much like Ratatoskr. Whatever the case, it is known that Heimdallr takes a dim view of any who might threaten Yggdrasil.<br /><br />Thus, when his keen gaze settled upon the creeping tendrils of Persephone’s minions, drawing ever closer to the World Tree, Heimdallr moved instantly to confront them. Powerful as she was, even the Queen of the Underworld could not hide her intentions from the watchman of Asgard… ',
