		lore: 'Heavy lies the head that wears the crown. If such an adage holds true, then surely the heads that seek to wear it must as well. Born of Osiris, and destined to ascend to the throne of the Egyptian Pantheon as its divine ruler, Horus is an entity of great power, whose formidable strength is mirrored by his innate desire for balance and justice.<br /><br />And yet, these grand attributes are not what has come to define Horus amongst the divine beings who walk the earth. Rather, it is strife, division and conflict that cling to him like a shadow. A shadow that has taken the form of his uncle, Set.<br /><br />Set stands in opposition to Horus’ ascension to rule, challenging so that he might be the one to take the throne and hold the destiny of their pantheon, lands and mortal worshipers in the palm of his hand. Thus has begun a path of chaos and destruction that has claimed countless lives, including that of venerable Osiris himself. Reeling from the cold-blooded murder of his father by his own uncle, Horus swore an oath to all creation, on pain of his own death, to set right the horrific deeds that had been perpetrated, and restore order, peace and justice to the land.<br /><br />For Horus, this conflict will see his kingdom restored to its full former glory, first among equals of all the Pantheons in creation, or should he fail, see all he knows and loves cast into darkness, corruption and ruin. He has become inextricably linked with Set, a shining reflection of his uncle’s brooding darkness. Horus knows in his heart that Set will stop at nothing to achieve his aims, and so he must do the same. For the fate of all, he must prevail, no matter the cost. ',
