		lore: 'Against the red rising sun, a winged form sweeps out to sea, claw clutched around a pebble. With focused grit, she hurls the small stone into the watery maw, circling above as it sinks into darkness. Resolved, she turns back to collect another. Jing Wei will not cease until the ocean is filled. That is her oath. And she will not break an oath.<br /><br />Once, she was a young girl, a princess, enamored by the glory of morning light. She gazed in wonder as her father, Yan Di, the Flame Emperor, shepherded the sun from the eastern sea. Desperately, she longed to reach the place where it emerged, but her father refused take her on the waters.<br /><br />One night, the princess sailed out alone, secretly hoping for a clear view come the dawn. But the waters were churning in a storm. Mountainous waves crashed into her tiny ship. The sea swallowed her whole.<br /><br />Yan Di woke and coaxed the sun from the horizon, only to find the shattered remains of his daughter’s boat upon the shore.<br /><br />Yet, even as he grieved, a bright goddess burst from the ocean and soared overhead. “Jingwei!” she cried, and Yan Di knew his daughter was reborn.<br /><br />Though given a second chance that day, Jing Wei swore an oath against the seas that took her life. She would fill them with stone until they were gone. An impossible task. But Jing Wei swore an oath. And Jing Wei will not break an oath.',
