		lore: 'It is often in the time of greatest strife, when a land and its people rest on the precipice of destruction, that a hero shall rise to deliver them from ruin. So it was in the ancient land of the Britons, a realm torn asunder by darkness and war, that the greatest king they would ever know would come. He was Arthur, son of Uther Pendragon, King and Warden of Camelot.<br /><br />His coming was prophesied by the great wizard Merlin, glimpsed in a comet burning though the night sky, herald of the monarch who would unite all Camelot and usher her into a new age of peace and prosperity. Though little older than a boy when King Uther fell and the mantle of ruler was passed down to him, Arthur would rise and take hold of his destiny as savior of his people. Benevolent and adept in statecraft, honourable and cunning in war, Arthur was the symbol of a new Briton.<br /><br />In his hand is Excalibur, that mythic blade of divine power that only the most just of rulers may wield. Ever since the fateful day she first came into his possession, the sword has never left Arthur’s side, and countless are the foes he has brought low with her, the blade’s power amplified even further by his exemplary prowess in battle.<br /><br />Arthur has withstood any foe who has sought Camelot’s downfall, be it the numberless hordes from beyond the seas or the sinister plots of those from within his own house. No matter the scheme, or the enemy, with the aid of his mage Merlin and his knights, Arthur has prevailed, for so long as he draws breath, Camelot’s lord shall not rest until her safety is won.<br /><br />Now, the great King hears the call of Avalon, and answers.',
