		health_per_lvl: 105,
		lore: "Do you hear it? That distant rumble like thunder across the mountains? Like pitched battle from miles away? Like a stampede of elephants across the plains? Know it is none of these things. That rumble you hear is the bellowing snore of Kumbhakarna, the Sleeping Giant.<br /><br />Quick with a laugh, honest with friends, but devastating in battle, Kumbhakarna embodies the traits of a hero, but loyalty to his tyrant brother, Ravana, often leads him to the wrong side.<br /><br />So jovial and pious is he, that when granted a boon by Brahma, Kumbhakarna wished to take Indra's place and rule the Heavens. Indra was jealously threatened, convinced Brahma would let the good-natured giant usurp him, and magically twisted Kumbhakarna's tongue at the last second. Instead of asking for “Indraasana” (Indra's Seat), he asked for “Nidraasana,” ... to sleep.<br /><br />Now, Kumbhakarna is a dozing behemoth, waking only once every six months. Yet, Ravana is concerned with the growing fervor of the battle between gods and demons, sensing his dominion slipping. Prematurely, he has awoken his brother and pressed him to fight. Though reluctant, as if he knows his brother's stance is unjust, Kumbhakarna fights out of loyalty and a warrior's code.<br /><br />Now, that rumbling you hear, it is not his snores, but Kumbhakarna's mighty roar. Or was that a yawn?",
