		health_per_lvl: 81,
		lore: 'Tales of Lancelot du Lac, the knight of the lake, have spread far and wide through the lands of men – and even unto the realms of the gods themselves. He is renowned as a peerless warrior and a courageous hero; the orphaned prince of a lost kingdom and ward of the Lady of the Lake herself. He serves at the right hand of King Arthur of Camelot, preeminent among the Knights of the Round Table. There are none among them whose deeds equal those of Lancelot, none who rival him as a swordsman or jouster.<br /><br />For was it not Lancelot who rescued Arthur’s bride, Guinevere, from the king of the Summer Country? Was it not Lancelot who rescued his fellow-knight Bedivere from beneath the spears of the enemy? Was it not Lancelot who bested the witch-princess Camille, and forced her to surrender her castle and kingdom? All this and more has Lancelot accomplished. He has bested the enemies of Camelot, both mortal and otherwise. He has slain giants and dragons. He has even faced the dark sorceries of Morgan Le Fay, and emerged unscathed. Such is the valor of Lancelot du Lac.<br /><br />But those are not the only tales of Lancelot. There are other stories – darker ones. They whisper of his ferocity, his sheer savagery in battle; not the eagerness of a knight, but the blood-hunger of berserker born. Some say that Lancelot is not as pure as he pretends. That a shadow rests upon him...and that there is treachery in his soul.<br /><br />But these tales are few and far between, and only the most cynical or dark-hearted find truth in them. For everyone else, the name of Lancelot is synonymous with heroism. And his time to join the battle has come.',
