		lore: 'Born to innocence, forced to fight, destined to be a hero, the child-god, Nezha, defends those that cannot defend themselves, especially against tyrant Gods.<br /><br />For three and a half years, Nezha’s mother carried him in her womb. During this time, the Dragon Gods, led by Ao Kuang, terrorized the people, sending floods and storms, and demanding not just food, but child sacrifices to feast upon as well.<br /><br />Into this world was Nezha born, a full grown boy with laughter in his eyes, trained by the immortal sage Taiyi Zhenren, who gave him the powerful Universe Ring and Armillary Sash. Youthful and carefree, Nezha was also headstrong, often arguing with his father what was right and wrong.<br /><br />But youth does not last forever, and Nezha’s life changed defending two friends against a captain of Ao Kuang’s army. Insulted, the Dragon God commanded his third son, Ao Bing, to defeat the boy, but in the end, Nehza slew his opponent. Furious with grief, Ao Kuang demanded Nezha’s father make reparations for the offense committed by his son, or he would send floods and storms to ravage the land. Nezha, humbly, sacrificed himself to appease the Dragon God, but evil Ao Kuang sent storms anyway.<br /><br />Taiyi Zhenren worked his wisdom, and from the petals of a Lotus plant, Nezha was reborn. The immortal sage gave him new weapons – the Fire Tipped Spear and Wind Fire Wheels – weapons to challenge even the Dragon God and defeat him once and for all.<br /><br />Time has passed since Ao Kuang’s ruin, but the winds of war are rising and new Gods of Tyranny challenge the safety of the defenseless. Once again, Nezha will set aside his youth and stand against the tide, for not even death can stop him.',
