		lore: 'Of arrogance and pride, the Greeks have but one word: hubris. It is a crime against Gods and Men, but a crime many commit with impunity. Even mighty Zeus is guilty. But when punishment is due, there is one from whom even the God of Thunder shrinks. She is Nemesis, the red-washed blade of Divine Retribution.<br /><br />Recall the tale of Narcissus, so taken by his own beauty. Proudly, his visage was flaunted, to the detriment of all. Until, at last, he was led to a pond of crystal hue where his own reflection enraptured him. So long did he remain to gaze upon this self-image that hunger claimed his life. Thus does Nemesis respond to hubris. It is consequence equal to the crime.<br /><br />Now, behold the war torn land, beset by the wrath of wanton Gods filling the air with blood and boasts. This battlefield is stained with hubris. Unwittingly, these foolish warriors have summoned their greatest adversary. Nemesis has come!<br /><br />No longer will foul deeds engender success, no hoard of wealth held in undeserving hands, no legends told when falsely earned. Nemesis will unleash a tide of retribution. Punishment for the crime of hubris is death.',
