		lore: 'When two warring Gods shattered the World Pillar, Heaven and Earth dangerously shifted, and Armageddon was unleashed. Firestorms, floods, and bloodthirsty monsters ravaged the land and stole the lives of more than can be counted. In ages past, Nu Wa, Guardian of Heaven and Earth, hand-crafted all people from clay. They were her creations, her children, her responsibility.<br /><br />As the Earth shuddered and broke, and the skies turned black with ash, Nu Wa forged five mystic stones, one for each of the elemental forces of nature: Earth, Water, Fire, Wood, and Metal. With the power of these stones, she slew a gargantuan tortoise, severed its legs, and raced to the broken World Pillar. One leg she used to prop the Heavens aloft and with the elemental stones, she sealed it in place. Balance between Heaven and Earth was restored, but the world was never the same. Skies cleared, but the stars had shifted. Seas retreated, but rivers drained westward. Everything leaned, but the End was averted.<br /><br />In the years that followed, Nu Wa and her brother, Fu Xi, took the throne of China. They ruled with wisdom and ushered in an age of recovery and prosperity, for which she is adored and worshipped to this day.<br /><br />Yet, the skies grow dark once more and chaos threatens to engulf the land. Gods from all Pantheons have chosen Earth as a battleground, trading blows with the same thoughtless fervor that destroyed the World Pillar so long ago. Determined to prevent such calamity from repeating, Nu Wa has summoned the elemental stones once more. For she is the Guardian of Heaven and Earth; all mankind are her creations, her children, her responsibility.',
