		lore: 'As the mountains and the seas have their gods, so too do the stars in the heavens. Greatest of their number is Olorun, God of the Sky and the Heavens, and supreme deity of the Yoruba pantheon. It was Olorun who kindled the spark that would become the sun, and at his command, the Orishas – the Yoruba gods – crafted the world and its inhabitants from the gathered dust of the cosmos.<br /><br />But though Olorun is the greatest of the Orishas, he seeks no worshipers and asks for no offerings, yet entire nations follow his ideals. Like the stars, he is a remote deity, content to sit in quiet contemplation of the myriad wonders of creation. And he is powerful enough to ensure the sanctity of his solitude. Olorun commands the fundamental forces of the cosmos – even time itself.<br /><br />Yet despite this power, Olorun is but one part of a greater whole. A tripartite being, Olorun possesses two other aspects – Olodumare, creator of the universe, and Olofi, the conduit between Earth and the Heavens. As befits a being of such might, Olorun is wise beyond measure, and rarely acts rashly or without some greater purpose in mind. Peaceful by nature, he will nonetheless fight when the need is great.<br /><br />It is for that very reason that Olorun has chosen to break his long seclusion at last. Despite having held himself apart from the world, he has borne witness to the suffering of mortal and immortal alike. With his far-reaching gaze, he has seen that the thrones of the great pantheons are empty, and that god wars against god.<br /><br />In his great wisdom, Olorun has realised that only a king can unite them.<br /><br />And he will be that king. ',
