		lore: 'Pele is the goddess of Fire, of Dance and Wind, of Volcanoes and Violence. Those who worship Pele speak of her as Madame Pele or Tutu Pele, while others know her as Ka wahine ‘ai honua, ‘the woman who devours the land’. Though she is capable of great acts of destruction, and possesses the temper to provoke such acts, Pele is both destroyer and creator. It was through her mastery over the world’s molten core that she wrought the Hawaiian Islands into being, forging them from the lava that ruptured forth from the mouths of her volcanoes. They are places of immense beauty, lush and brimming with life, and by looking upon and revelling in such beauty, you offer Pele worship.<br /><br />Born of Kane Milohai, who wrought the earth, sky and heavens, and the Earth goddess Haumea, Pele is one of fourteen children, seven sisters and seven brothers. It is from the enmity between these siblings that Pele arrived in Hawaii, after her exile at the hands of Kane Milohai for her fiery temper and conflict with her sister Namakaokahai, goddess of the Sea. Pursued across the oceans by Namakaikahai, Pele wrought Hawaii into a paradise, making her home within the great calderas of the volcanoes that stand sentinel across the island chain.<br /><br />To worship Pele is to grant one’s devotion to a goddess of terrible power, one who can shape and render a grand, vibrant world into being at her slightest whim, and burn it to ashes just as quickly. But just as her worshipers are devoted to Pele, she devotes herself to them as a force of divine protection and care. She is a tireless defender of life and the people that dwell upon her islands, and any that seek to threaten them shall surely taste Pele’s fire.',
