		lore: 'Thunder is a terrifying element, trembling the very earth with its sound. Herald to storms, accomplice to lightning, thunder is primal, powerful and chaotic. Let this speak, then, of its master, the demon faced God, Raijin, who summons this force with the pounding of his great drums.<br /><br />Ever in conflict with his equally fearsome brother, Fujin, Master of Wind, Raijin vies for control of the skies above the Realm of the Rising Sun. For mortals, their battles form dramatic storms and devastating tidal waves, but for the brothers, this is just friendly competition; an ongoing tournament to determine the strongest.<br /><br />Though monstrous in appearance and intimidating in battle, Raijin is generous to his Faithful, clearing the detritus with lightning to leave rice fields all the more fertile. That doesn’t stop parents from warning their children to hide when a storm comes, lest Raijin devour their bellies. Raijin no doubt finds this tale amusing but has yet to actually feast on any toddlers.<br /><br />War has reached the distant shores of Raijin’s island realm, and for the first time, he has encountered other Gods that claim dominion over lightning, thunder, and the sky itself. Relishing this opportunity to prove dominance, Raijin enters the fray, drums pounding, and his boisterous laugh indistinguishable from rolling thunder.',
