		lore: 'Power does not come without sacrifice. The greater the sacrifice, the more immeasurable the power. Ravana, the Demon King of Lanka knew this. For years he worshipped, showing his devotion through isolation, prayer, and penance before the shrine of Shiva. Yet for years he was met with only silence. In his pursuit of immortality, he sacrificed his very life. He cut off his own head.<br /><br />Agony and pain met him as it regrew. He was greeted not by Death, but by rejection. Shiva the destroyer did not want him. Ravana was undaunted. Nine more times his head was offered, and on his tenth sacrifice, finally Shiva was sated.<br /><br />For the Demon King, Shiva granted a boon. Instead of immortality, he gained invulnerability against those he viewed as threats: Gods and Demons. Ravana could not be destroyed.<br /><br />A master of combat, a genius scholar, a peerless leader, and now invincible, Ravana amassed an army of fiends and monsters to conquer the world. None could stop him. The Monkey King tried, but Ravana fought off his attacks. The Demon King’s armies conquered all, leaving Ravana to rule from a golden throne.<br /><br />Vishnu, in his wisdom and grace, would not permit Ravana’s dominance. By Gods and Demons Ravana could not be harmed, but by mortals...<br /><br />Thus was Vishnu reborn Rama, a mere man. Now trained as a warrior, Rama calls the Demon King to battle.<br /><br />Pride scraping like a knee on stone, Ravana rallies his monstrous siblings, his conquered allies, and his formidable army to answer Rama’s taunt. And their rivalry will shake the world.',
