		lore: 'Worlds end, when the Destroyer dances. But so too do worlds begin, as Destroyer becomes Benefactor. It is the eternal cycle of destruction and creation, a cosmic song heard by all, but the steps of its dance are known only to one – the Lord of Dancers, Shiva.<br /><br />A god of ambiguity and paradox, Shiva has as many names as there are stars in the sky. He is the embodiment of grace and compassion, but also the roaring storm which sweeps away all that stands before it. He comes in forms both fearsome and benign; destroyer and creator in one. To Shiva falls the responsibility of ensuring the sanctity of all that is. This duty requires both ferocity and mercy, for it is Shiva who must stand against the all-consuming dark and conjure light from its depths with his dance.<br /><br />When the world has reached its end, it is Shiva who ushers it into oblivion. His dance, once begun, cannot be ended save in cataclysm. A purifying conflagration that reduces the old and weary world to ashes, so that something new might rise in its place. Thus has Shiva come now to the world and revealed himself to the warring gods who populate it. By his dance will the mistakes of the past be undone...and a new beginning allowed to commence.',
