		health_per_lvl: 100,
		lore: 'Terra Mater, quite literally the mother Earth, rests dormant beneath every living thing. Upon her flesh, trees stand like hairs, rivers weave like veins, and oceans lap against her sides. Long has she slept; since her son, the Titan Saturn, was cast down by his own son. It had all gone so wrong.<br /><br />At the forging of creation, Terra was split from all other primordial matter to form the earth. Above her, Uranus, the sky, suspended angelically. She loved him immediately and made him her king. Their children were Titans, beings even more powerful than they. In his fear and jealousy, Uranus buried the Titans within the earth. Terra began to see the arrogance, the vanity, the hatred in her husband. Conspiring with her children, she freed them and overthrew Uranus.<br /><br />Youngest of the Titans, Saturn, ruled next. Terra could not have been more proud, but prophecies claimed Saturn would be defeated by his children, just as Uranus had. To prevent this, Saturn consumed his offspring. All but one. Jupiter escaped, and with righteous fury split Saturn open, unleashing his swallowed siblings. Violently, they defeated the Titans, Terra’s children, and claimed the world as their own.<br /><br />Mournful of the children she lost, Terra slept. And ages passed.<br /><br />But the ravages of a new war have scarred her skin. Her grandchildren, those arrogant, vain, treacherous Gods that stole the world from her son, those Gods, so reminiscent of Uranus, bleed into her bones with every battle. Now, she finally rises from her slumber. She rises to claim the throne for herself.',
