		lore: 'Legends tell of a tome of magic, wherein all the secrets of the world can be found, where the spells to change the fabric of reality are written, and where the knowledge to master death is inscribed. The legends understate reality. So powerful is this book that the mere flipping of pages sets Gods on edge.<br /><br />This lexicon of legerdemain was no product of happenstance. Every incantation, every inflection was carefully crafted by a God beyond comprehension, of wisdom so transcendent, he willed himself into being. He is Thoth, the Scribe of Secrets.<br /><br />Three great battles there have been, and at each, Thoth was present, aiding the forces of order to triumph over chaos. When Ra faced the world serpent Apep for the final time, Thoth’s spells shielded Ra against the reptile. When Osiris was dismembered by his brother Set, Thoth taught Eset the incantations to reassemble him. And when Horus, the child of Eset and Osiris, battled Set once again for control of the Kingdom, Thoth’s rituals cleansed the young man of Set’s vilest poisons.<br /><br />All of the secrets, the power, the wisdom of the universe, Thoth has placed into this book. He is the guardian of this knowledge, invoking it only to save the world, to keep it from descending into disorder.<br /><br />But now, the world is falling into chaos. God battles God. The heavens quake, the earth shudders, the seas boil, and mortals cry out. If ever there was a time for Thoth to break the binding of his book, it is now. This world is unprepared for the secrets he will reveal.',
