		health_per_lvl: 82,
		lore: 'Might makes right. To impose order, to bend the world to your will – these are the marks of a true leader. Only a true leader has the strength of will and the force of arms to make his enemies bow before him. Only a true leader deserves the respect and adulation of his followers.<br /><br />These are the guiding principles of Tsukuyomi’s existence. Proud, but violent, he is the God of the Moon and the Night. Wielding his twin tonfa, Shingetsu and Mangetsu, he overcomes his enemies with effortless skill and a mocking laugh, forcing them to bow before him – for what good is victory without an audience to see it?<br /><br />He is the opposite in every way of his sibling, Amaterasu. Where she is light, he is dark. Where she is kind, he is cruel. But in his cruelty there is purpose. A true leader cannot show weakness, cannot brook insult – even one unintentionally given.<br /><br />Such was the reason that Tsukuyomi struck off the head of the goddess of plenty, Uke Mochi. For her manner offended him, and offense must be answered as swiftly and surely as possible, lest weakness be revealed. Order must be maintained, whatever the cost.<br /><br />Amaterasu did not understand. She cast Tsukuyomi from her sight, forever exiling him from the heavens. The day would be hers, and the night his. Another insult, but one Tsukuyomi has borne in silence...until now.<br /><br />For now, the Great Dreamer has awakened and cast a shroud of madness across the world and its peoples. The order of all things breaks down, and weakling gods like Amaterasu falter.<br /><br />But a true leader sees opportunity in chaos.<br /><br />The time of Amaterasu and her followers is done. Tsukuyomi seeks to impose a new order upon things – one more to his liking. A long night falls across the world.<br /><br />And now, a new moon rises...',
