		health: 679,
		health_per_5: 8,
		health_per_lvl: 87,
		lore: 'Tyr. The embodiment of mankind’s impossible ideals. Man is a malleable creature, but a God is stone, shaped only by the harsh weather of expectation. And none have a greater burden of expectation than Tyr, for he is Courage. He is Honor. He is Justice.<br /><br />Courage is not the absence of fear, but the will to face the frightening.<br /><br />Fenrir, the mighty wolf, was foretold to wreak such devastation on the Gods that they sought to bind him. Tyr, clothed in courage, brought the beast to their prison, where the Gods prepared shackles.<br /><br />Honor is not a stubborn oath, but the integrity to uphold what is right, even when it is not easy.<br /><br />Under the guise of a test of strength, twice the Gods bound Fenrir, and twice he broke free. On the third attempt, Fenrir sensed a trick and demanded one of the Gods place their hand into his mouth. If the binding proved magical, Fenrir would take the hand. Tyr agreed.<br /><br />Justice is not adherence to the law, but a code of fairness and morality.<br /><br />Bound by the mystical ribbon, Fenrir devoured Tyr’s hand. It was the price to be paid. And Tyr paid it willingly. Even Fenrir deserved justice.<br /><br />One handed, Tyr is worshipped as a pinnacle of righteousness, called upon for valor in battle, balance in law, and the fortitude to face the impossible. As the cloud of war blackens the world, and fear grips the people, Tyr is stooped by the weight of expectation. With blade in hand, he takes the field. For he is Courage. He is Honor. He is Justice.',
