		lore: 'King of Gods, Zeus strives for fairness and justice, but will not hesitate to call down the thunder when there’s smiting to be done!<br /><br />Zeus’ father, the Titan Cronus, immediately swallowed his children after birth so that none could overthrow him as he had his own father. When Zeus was born, Rhea, Zeus’ mother, hid the child from Cronus and gave the Titan a rock in swaddling clothes, which he swallowed instead. In secret, Zeus grew up on the isle of Crete until he was old and strong enough to challenge his father. During their battle, Zeus slit open Cronus’ stomach, allowing his swallowed brothers and sisters to escape, slaying the Titan. Then, Zeus released the Cyclops and other beings Cronus had kept imprisoned. In gratitude, the Cyclops awarded Zeus control over lightning.<br /><br />With his two brothers, Poseidon and Hades, the three Gods drew lots to decide command of creation. Poseidon became king of the sea, Hades the underworld, and Zeus the sky. From his golden throne atop Mount Olympus, Zeus now rules Gods and Men with his wife Hera, upholding justice, hospitality, oaths, and honesty to all under his domain.<br /><br />Yet, Zeus is a restless God, and while he holds high expectations for others, he does not keep those standards for himself. Chiefly, Zeus is nearly infamous for several infidelities to his wife which have resulted in dozens of children beget by other women, most famous of which are Hercules, Artemis, and Athena. Such wanton unfaithfulness is the source of great jealousy from Hera, though as King, Zeus can ultimately do as he wishes.<br /><br />Weather is dictated by the Thunder God’s mood. When in a fair temperament, the sky is clear, bright and warm. When Zeus’ anger flares, black clouds roll in, lightning streaks the sky and thunder shakes the very ground. Lately, Zeus has been furious.',
